import React, { useEffect, useState } from 'react';
import {
  MDBContainer,
  MDBTabs,
  MDBTabsItem,
  MDBTabsLink,
  MDBTabsContent,
  MDBTabsPane,
  MDBBtn,
  MDBInput,
  MDBTypography,
}
from 'mdb-react-ui-kit';
import axios from "axios"

function SecondForm() {

    const [login, setLogin] = useState();
    const [pw, setPw] = useState();


    const makeLogin = async () => {
        let formData = new FormData(document.getElementById("myForm"))

        const headers = {
            'accept': 'application/json',
            'Content-Type': 'application/x-www-form-urlencoded'
        };
        axios.post("http://localhost:8000/token", formData, headers,
        ).then(result => {console.log(result)})
    }


    return (
        <form id="myForm">
            <p>{login}</p>
            <p>{pw}</p>
            <input name="username" onChange={(e) => setLogin(e.target.value)} value={login} type='text'></input>
            <input name="password" onChange={(e) => setPw(e.target.value)} value={pw} type='password'></input>
            <button type="button" onClick={makeLogin}>Send data</button>
        </form>
    )
}

export default SecondForm;
